import "../details.component/pubg.details.css";
import apple from "../../Images//pubgcard.jpg";
const UC = [
    { id: 1, className: "card-1", image: apple },
    { id: 2, className: "card-2", image: apple },
    { id: 3, className: "card-3", image: apple },
    { id: 4, className: "card-4", image: apple },
  ];
export default function Pubgdetails() {
  return 
  (
        <div className="container-details">
            <div className="head-rec">
            <p>PUBG 325 UC PINS (Global)</p>
            </div>
            <div className="pubgcard">
            </div>
        </div>
  );
}
